import React from 'react';
import Header from "../Header";
import Footer from "../Footer";
import Films from "../Films";



const Film = () => {
    return (
        <div>
            <Header/>
            <Films title={"Słowacja/Węgry 05.2022"} text={"Wyjazd na Węgry, po drodze spotkałem Adriana z kanału Motopodhale. Zwiedziłem między innymi takie miejsca jak Eger, Słowacki Raj jak i nasze Morskie Oko."} image={"https://i.ytimg.com/an_webp/JUZTT_6GJrM/mqdefault_6s.webp?du=3000&sqp=CKns3JwG&rs=AOn4CLDEqhYmhvlWMZSOZ2LWE2kvPgbQUg"}/>
            <Films title={"Wyjazd do Białej Podlaskiej 06.2020"} text={"Wypad z Łukaszem na jego Derbi Terra 125. Przejazd przez jezioro Białe, Białą Podlaskę i camping nad Wiłą pod Puławami."} image={"https://i9.ytimg.com/vi_webp/ye3xnsuUK-Y/mqdefault.webp?v=5fc4af52&sqp=CPDO3ZwG&rs=AOn4CLBdcResAy5f95PU5BomBADqPnFfPw"}/>
            <Films title={"Wyjazd do Zakopanego 06.2020"} text={"Szybki 2 dniowy wyjazd do Zakopanego z chłopakami z Lublina, zwiedżanie okolic Zakopca."} image={"https://i9.ytimg.com/vi_webp/alDD2hn4-ss/mqdefault.webp?sqp=CPDO3ZwG&rs=AOn4CLBdip8tsFAIwfLqOvtsFTU2a3gRFQ"}/>
            <Films title={"Offroad'owy wyjazd do Gdaśka 05.2020"} text={"Wyjazd głównie w off'ie. Jechalem z Michałem na jego nowym bmw 850gs adv."} image={"https://i9.ytimg.com/vi_webp/wcm88SMwu-c/mqdefault.webp?v=5f0e97f5&sqp=CPDO3ZwG&rs=AOn4CLAilY3Uyw5QrvasEJkA_crHAyD7pg"}/>
            <Films title={"Offroad z grupa z grupą z Tczewa. 09.2019"} text={"Wyjazd dużą ekipą po okolicach Tczewa. Chłopaki i dziewczyny dobrze nakręceni na off'y :D."} image={"https://i9.ytimg.com/vi_webp/alDD2hn4-ss/mqdefault.webp?sqp=CPDO3ZwG&rs=AOn4CLBdip8tsFAIwfLqOvtsFTU2a3gRFQ"}/>
            <Films title={"Zlot Lesko 08.2019"} text={"Jeden z pierwszych wyjazdów na zlot motocyklowy. Bardzo duża ilość fajnych wspomnień. Jechałem z Krystianem na jego Hondzie Cbf 600."} image={"https://i9.ytimg.com/vi_webp/alDD2hn4-ss/mqdefault.webp?sqp=CPDO3ZwG&rs=AOn4CLBdip8tsFAIwfLqOvtsFTU2a3gRFQ"}/>
            <Footer/>
        </div>
    );
};

export default Film;
